import ReactDom from "react-dom";

function Overlay() {
  const overlayStyle = {
    position: "fixed",
    top: 0,
    right: 0,
    bottom: 0,
    left: 0,
    backgroundColor: "black",
    zIndex: 1000,
  };

  return ReactDom.createPortal(<div style={overlayStyle}>hola</div>, document.getElementById("portal"));
}

export default Overlay;
